import './aboutMe.scss'
import NavTab from '../NavTab/NavTab'
function AboutMe (){
    return (
        <section className="aboutme">
            <h1 className='aboutme__title'>Студент</h1>
            <div className='aboutme__info'>
                <div className='aboutme__texts'>
                    <h1 className='aboutme__name'>Александр</h1>
                    <h2 className='aboutme__profession'>Фронтенд-разработчик, 30 лет</h2>
                    <p className='aboutme__about'>Я родился и живу в Саратове, закончил факультет экономики СГУ. У меня есть жена
и дочь. Я люблю слушать музыку, а ещё увлекаюсь бегом. Недавно начал кодить. С 2015 года работал в компании «СКБ Контур». После того, как прошёл курс по веб-разработке, начал заниматься фриланс-заказами и ушёл с постоянной работы.</p>
                </div>
                <div className='aboutme__photo'></div>
            </div>


        </section>
    );
}

export default AboutMe;
